import { Component } from '@angular/core';
import { NavParams, Platform, ViewController,ActionSheetController} from 'ionic-angular';
import {Camera} from 'ionic-native';
import { ImagePicker } from 'ionic-native';
import {Backand} from "../../providers/backand";

@Component({
  selector: 'page-modalquestion',
  templateUrl: 'modalquestion.html',
})
export class Modalquestion {

  ques:any;
  public base64Image: string;
  images: any;

  constructor(
    public platform: Platform,
    public params: NavParams,
    public viewCtrl: ViewController,
    public actionsheetCtrl: ActionSheetController,
    public backand: Backand) {
    this.images =[];

  }

  dismiss() {
    this.viewCtrl.dismiss();
  }

  save(){
    this.viewCtrl.dismiss(this.ques);
  }


  takePicture(){
    let options = {
      destinationType: Camera.DestinationType.DATA_URL,
      sourceType: Camera.PictureSourceType.CAMERA,
      targetWidth: 500,
      targetHeight: 500
    }

    Camera.getPicture(options).then((imageData) => {
      this.images.push("data:image/jpeg;base64," + imageData);
      // this.backand.uploadImageP().subscribe(
      //   data => {
      //     console.log("done")
      //   },
      //   err => this.logError(err)
      // );
    }, (err) => {
      console.log(err);
    });
  }



  getLibrary(){
    let options = {
      maximumImagesCount: 8,
      width: 500,
      height: 500,
      quality: 75
    }

    ImagePicker.getPictures(options).then(
      file_uris => this.images = file_uris,
      err => console.log('uh oh')
    );
  }

  openImageMenu() {
    let actionSheet = this.actionsheetCtrl.create({
      title: 'Add image',
      cssClass: 'action-sheets-basic-page',
      buttons: [
        {
          text: 'Use Camera',
          handler: () => {
            this.takePicture();
          }
        },
        {
          text: 'Upload from Library',
          handler: () => {
            this.getLibrary();
          }
        },
        {
          text: 'Cancel',
          role: 'cancel', // will always sort to be on the bottom
          icon: !this.platform.is('ios') ? 'close' : null,
          handler: () => {
            console.log('Cancel clicked');
          }
        }
      ]
    });
    actionSheet.present();
  }

  public logError(err: TemplateStringsArray) {
    console.error('Error: ' + err);
  }

}


